//import 'aframe';
//import { Scene, Entity } from 'aframe-react';
import React from 'react';
import './VRex.css';

 
function VREx(props) {
const productId=props.location.pid.myval;
const modelurl='Images/thredmodels/'+productId+'.glb'
  return (
    <div className="vrEx">
 <a-scene>
  <a-entity gltf-model={modelurl} scale="0.2 0.2 0.2"  position="2 1 -10" >
     </a-entity>
    </a-scene> 
    </div>
    );
}


export default VREx;
